import PortfolioStockContainer from "./PortfolioStockContainer";


const RightPortCol = (props) => {

  return (
    <div className="upper-col" style={props.openApp ? {width: '25%'} : {width: '50%'}}>
         {props.finalUpperArr.map(data =>
               <PortfolioStockContainer activePortfolio={props.activePortfolio} openApp={props.openApp} toggleActiveUpper={props.toggleActiveDowner} key={data.id} data={data}/>
               )}    
    </div>
  );
};

export default RightPortCol;
